import React, { useState } from 'react'
import { makeStyles, withStyles } from '@material-ui/core/styles'
import Button from '@material-ui/core/Button'
import Container from '@material-ui/core/Container'
import TypeWriterEffect from 'react-typewriter-effect';
import Box from '@material-ui/core/Box'

const useStyles = makeStyles((theme) => ({
    logo: {
      alignSelf: 'start'
    },
    card: {
      display: 'flex',
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center',
      flexDirection: 'column'
    },
    title: {
      color: 'white',
      textAlign: 'center'
    },
    animateWrapper: {
      display: 'flex',
      flex: 1,
      justifyContent: 'center',
      alignItems: 'center',
    },
    body: {
        padding: theme.spacing(10),
        paddingLeft: theme.spacing(75),
        paddingRight: theme.spacing(75)
    },
    form: {
        backgroundColor: 'white',
        padding: theme.spacing(5),
        borderRadius: 5,
        boxShadow: '0px 0px 10px 3px rgba(0, 0, 0, .3)',
        display: 'flex',
        flex: 1,
        flexDirection: 'column',
        justifyContent: 'center',
        alignItems: 'center'
    }
  }))

  const BootstrapButton = withStyles({
    root: {
      color: 'white',
      boxShadow: 'none',
      textTransform: 'none',
      fontSize: 14,
      padding: '6px 200px',
      border: '1px solid',
      lineHeight: 1.5,
      backgroundColor: '#1652F0',
      borderColor: '#0063cc',
      fontFamily: 'Red Hat Display',
      '&:hover': {
        backgroundColor: '#0069d9',
        borderColor: '#0062cc',
        boxShadow: 'none',
      },
      '&:active': {
        boxShadow: 'none',
        backgroundColor: '#0062cc',
        borderColor: '#005cbf',
      },
      '&:focus': {
        boxShadow: '0 0 0 0.2rem rgba(0,123,255,.5)',
      },
    },
  })(Button);

const Results = ({onClear, prediction}) => {
    const classes = useStyles()
    const [selection, setSelection] = useState('')
    const myRef = document.querySelector('.scrollable-div')

    return (
        <div className={classes.body}>
        <Container className={classes.body}>
            <TypeWriterEffect
                textStyle={{ fontFamily: 'Red Hat Display', color: 'white', textAlign: 'center' }}
                startDelay={100}
                cursorColor="white"
                text="Predict. Research. Invest."
                typeSpeed={100}
                hideCursorAfterText={true}
                scrollArea={myRef}
                className={classes.title}
                />
                <Box pt={10} className={classes.card}>
                <InputForm className={classes.form} onSubmit={onSubmit} />
                </Box>
            </Container>
        </div>
    );
}

export default Results
